title('GPS Satellite Trajectories in ECEF Coordinate System', 'FontSize', 14);
% Draw Earth sphere
RE = 6378137; % Earth radius in meters
[Xe, Ye, Ze] = sphere(50);
surf(Xe*RE, Ye*RE, Ze*RE, 'FaceColor', [0.7 0.7 0.9], 'EdgeColor', 'none', 'FaceAlpha', 0.3);

